import React from 'react';
import { ProductConsumer } from "../../context";
import CartItem from "./CartItem";

const CartList = () => {
    return ( 
        <>
            <ProductConsumer>
                <div className="container-fluid">
                    {values => {
                        return values.cart.map(item => {
                            return ( 
                                <CartItem key={item.id} item={item} /> 
                            );
                        });
                    }}
                </div>
            </ProductConsumer>
        </>
     );
}

export default CartList;
